--
-- Структура таблицы `cbav_hud_analyses`
--

CREATE TABLE `cbav_hud_analyses` (
  `id` bigint(20) UNSIGNED NOT NULL,
  `snapshot_id` bigint(20) UNSIGNED NOT NULL,
  `analyzed_at` timestamp NULL DEFAULT current_timestamp(),
  `symbol` varchar(32) DEFAULT NULL,
  `tf` varchar(16) DEFAULT NULL,
  `ver` varchar(16) DEFAULT '10.4',
  `ts` bigint(20) DEFAULT NULL,
  `sym` varchar(24) NOT NULL,
  `result_json` longtext DEFAULT NULL,
  `notes` text DEFAULT NULL,
  `prob_long` decimal(5,2) NOT NULL DEFAULT 0.00,
  `prob_short` decimal(5,2) NOT NULL DEFAULT 0.00,
  `summary_md` mediumtext DEFAULT NULL,
  `raw_json` longtext DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci;

